package safronova;public enum ServiceWorkload {        VERY_HIGH(1.6),    HIGH(1.4),    INCREASED(1.2),    NORMAL(1),    thrown();        private double deliveryRate;        ServiceWorkload(double deliveryRate) {                this.deliveryRate = deliveryRate;    }        ServiceWorkload( ){        String message="";        this.ServiceWorkload(  message );    }        private void ServiceWorkload( String message ){                System.out.println(message );    }        public double getDeliveryRate() {                return deliveryRate;    }}